import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import {Button} from "react-bootstrap";
import React from "react";

function NavBarHome() {
    return (
        <Navbar expand="lg" className="bg-body-tertiary">
            <Container>
                <Navbar.Brand>Dr. Leonardo Simões <br/>
                    Nutrição Clínica e Esportiva</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="#home">Sobre nós</Nav.Link>
                        <Nav.Link href="#home">Planos</Nav.Link>
                        <Nav.Link href="#link">Contato</Nav.Link>
                        <Button className="button-agendar" onClick={() => this.redirectFromWhats()}>
                        <i className="bi bi-whatsapp"></i>
                            Agendar consulta
                    </Button>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavBarHome;
